import Menu from './Componentes/Menu';
import { BrowserRouter } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import Rotas from './rotas';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header>
          <Menu />
        </header>
        <main>
          <Container fluid>
            <Rotas />
          </Container>
        </main>
        <footer>

        </footer>
      </div>
    </BrowserRouter>
  )
}

export default App;
